  <!-- Standard Header/Footer styles -->
  <link rel="stylesheet" href="styles.css">
  
  <style>
    /* Full-page layout: header, main (scrollable calendar), footer */
    html, body {
      margin: 0;
      padding: 0;
      height: 100vh;
      display: flex;
      flex-direction: column;
      overflow: hidden;
    }
    header, footer {
      flex: 0 0 60px;
      width: 100%;
      box-sizing: border-box;
      position: relative;
      z-index: 1000;
    }
    main {
      flex: 1;
      position: relative;
      overflow-y: auto; /* full-page scrolling */
      background: #fff;
      padding-top: 10px;
    }
    /* Calendar Intro Section */
    #calendar-header {
      padding: 40px 20px 20px 20px;
      max-width: 1000px;
      margin: 0 auto;
      text-align: center;
    }
    #calendar-header h1 {
      margin: 0 0 10px;
      font-size: 2em;
      font-family: 'Moon Bold', sans-serif;
    }
    #calendar-header p {
      margin: 0 0 10px;
      font-size: 1.1em;
      font-family: 'Moon Light', sans-serif;
    }
    #calendar-key {
      font-size: 0.9em;
      font-family: 'Moon Light', sans-serif;
      color: #555;
    }
    #calendar-key span {
      display: inline-block;
      margin-right: 15px;
    }
    /* Calendar List Styling */
    #contentArea {
      list-style: none;
      margin: 0 auto;
      padding: 20px 20px 0 20px;
      max-width: 1000px;
    }
    /* Uniform row heights for both day rows and month labels */
    .day-box,
    .month-label {
      height: 40px;
      line-height: 40px;
      padding-left: 10px;
      font-size: 14px;
      background: #fff;
      white-space: nowrap;
      overflow: visible;
      margin: 0;
    }
    .day-box {
      border-bottom: 1px solid #ccc;
    }
    .month-label {
      font-size: 12px;
      font-weight: bold;
      background: #eee;
      color: #666;
    }
    /* Cosmic Icon Styles */
    .cosmic-icon {
      display: inline-block;
      width: 30px;
      height: 30px;
      margin-left: 5px;
      vertical-align: middle;
      position: relative;
      cursor: pointer;
      background-size: contain;
      background-repeat: no-repeat;
    }
    .cosmic-icon::after {
      content: attr(data-tooltip);
      position: absolute;
      top: 100%;
      left: 50%;
      transform: translate(-50%, 5px);
      background: rgba(0,0,0,0.8);
      color: #fff;
      padding: 3px 6px;
      font-size: 12px;
      border-radius: 3px;
      white-space: nowrap;
      opacity: 0;
      visibility: hidden;
      transition: opacity 0.2s ease, transform 0.2s ease;
      pointer-events: none;
      z-index: 1200;
    }
    .cosmic-icon:hover::after {
      opacity: 1;
      visibility: visible;
      transform: translate(-50%, 0);
    }
    /* Sticky Back Button */
    #backButton {
      position: sticky;
      top: 0;
      left: 10px;
      z-index: 1100;
      background: #fff;
      border: 1px solid #000;
      width: 36px;
      height: 36px;
      border-radius: 50%;
      text-align: center;
      line-height: 34px;
      font-size: 18px;
      color: #000;
      cursor: pointer;
    }
    /* Custom Scrollbar Container */
    #custom-scrollbar {
      position: fixed;
      right: 0;
      top: 60px;
      width: 30px;
      height: calc(100vh - 120px);
      background: #eee;
      z-index: 1150;
    }
    /* Scroll Indicator */
    #scroll-indicator {
      position: absolute;
      left: 0;
      right: 0;
      height: 4px;
      background: #999;
      top: 0;
    }
  </style>

  <!-- 2. Custom Calendar Script Using Precomputed Cosmic Events Data -->
  <script>
    document.addEventListener("DOMContentLoaded", function() {
      // Mapping from event type to icon URL and tooltip
      const eventMapping = {
        "fullmoon": {
          icon: "https://marketplace.canva.com/MADCSJcoCFU/1/thumbnail_large-1/canva-full-moon-isolated-MADCSJcoCFU.png",
          tooltip: "Full Moon"
        },
        "marsopposition": {
          icon: "https://www.aquinas.edu/foster-planet-walk/images/mars.png",
          tooltip: "Mars Opposition"
        },
        "jupiteropposition": {
          icon: "https://www.solarsystemscope.com/spacepedia/images/handbook/renders/jupiter.png",
          tooltip: "Jupiter Opposition"
        },
        "saturnopposition": {
          icon: "https://www.coolaboo.com/wp-content/uploads/2019/03/saturn.png",
          tooltip: "Saturn Opposition"
        }
      };
      
      // Helper: format date as "YYYY-MM-DD"
      function formatDate(date) {
        const y = date.getFullYear();
        const m = (date.getMonth() + 1).toString().padStart(2, '0');
        const d = date.getDate().toString().padStart(2, '0');
        return `${y}-${m}-${d}`;
      }
      
      // Define calendar range: Jan 1, 2025 to Dec 31, 3000
      const startDate = new Date("2025-01-01T00:00:00");
      const endDate = new Date("3000-12-31T23:59:59");
      
      // Generate calendar rows
      const rows = [];
      let currentDate = new Date(startDate);
      while (currentDate <= endDate) {
        const dateStr = formatDate(currentDate);
        if (currentDate.getDate() === 1) {
          rows.push(`<li class="month-label">${currentDate.toLocaleString('default', { month: 'long' })} ${currentDate.getFullYear()}</li>`);
        }
        let iconsHTML = "";
        if (cosmicEventsByDate[dateStr]) {
          cosmicEventsByDate[dateStr].forEach(type => {
            const mapping = eventMapping[type];
            if (mapping) {
              iconsHTML += `<span class="cosmic-icon" style="background-image: url('${mapping.icon}');" data-tooltip="${mapping.tooltip}"></span>`;
            }
          });
        }
        rows.push(`<li class="day-box">${dateStr}${iconsHTML}</li>`);
        currentDate = new Date(currentDate.getTime() + 86400000);
      }
      
      console.log("Generated rows:", rows.length);
      
      new Clusterize({
        rows: rows,
        scrollId: 'main-scroll',
        contentId: 'contentArea',
        rows_in_block: 20,
        blocks_in_cluster: 4
      });
    });
  </script>
  
  <!-- 3. Custom Scroll Indicator Script -->
  <script>
    document.addEventListener("DOMContentLoaded", function() {
      const mainScroll = document.getElementById("main-scroll");
      mainScroll.addEventListener("scroll", function() {
        const scrollTop = mainScroll.scrollTop;
        const scrollHeight = mainScroll.scrollHeight - mainScroll.clientHeight;
        const scrollPercent = scrollTop / scrollHeight;
        const scrollbar = document.getElementById("custom-scrollbar");
        const indicator = document.getElementById("scroll-indicator");
        const scrollbarHeight = scrollbar.clientHeight;
        const indicatorTop = scrollPercent * scrollbarHeight;
        indicator.style.top = indicatorTop + "px";
      });
    });
  </script>
  
  <!-- Cosmic Icon Tooltip CSS -->
  <style>
    .cosmic-icon {
      position: relative;
    }
    .cosmic-icon::after {
      content: attr(data-tooltip);
      position: absolute;
      top: 100%;
      left: 50%;
      transform: translate(-50%, 5px);
      background: rgba(0,0,0,0.8);
      color: #fff;
      padding: 3px 6px;
      font-size: 12px;
      border-radius: 3px;
      white-space: nowrap;
      opacity: 0;
      visibility: hidden;
      transition: opacity 0.2s ease, transform 0.2s ease;
      pointer-events: none;
      z-index: 1200;
    }
    .cosmic-icon:hover::after {
      opacity: 1;
      visibility: visible;
      transform: translate(-50%, 0);
    }
  </style>
